/* Laniakea: Alternative image on hover */

$(document).ready(function () {
    $(function () {
        $('.img-hovered').hover(sourceSwap, sourceSwap);
    });
});

var sourceSwap = function () {
    var $this = $(this);
    var newSource = $this.data('alt-src');
    $this.data('alt-src', $this.attr('src'));
    $this.attr('src', newSource);
}
// Store - Order
$(document).ready(function () {
    // Pickup type
    var selected = $("input[type='radio'][name='shipping']:checked").val();
    if (selected == 6) {
        $('#pickups').show();
    } else {
        $('#pickups').hide();
    }

    $("input[type='radio'][name='shipping']").click(function () {
        var selected = $("input[type='radio'][name='shipping']:checked").val();

        if (selected == 6) {
            $('#pickups').show();
        } else {
            $('#pickups').hide();
        }
    });

    $('.delivery').hide();
    $('#delivery_show').click(function (event) {
        event.preventDefault();
        $('.delivery').show(200);
        return false;
    });

    if ($('input[name=delivery]').val() === "1") {
        $('.address-form').show();
        $('input[name=insertaddress]').attr('checked', true);
    } else {
        $('.address-form').hide();
    }


    $('input[type=checkbox][name=insertaddress]').change(function (event) {
        event.preventDefault();

        if (this.checked) {
            $('.address-form').show(100);
        } else {
            $('.address-form').hide();
        }
        return false;
    });

    // Cart transition on click
    $('.add-to-cart').submit(function (e) {
        $('.cart-box').addClass("cart-box-animate");
    });


    // Fill addresses
    $("select[name=addresses]").change(function () {
        var addressB = $("#addressarr").val();
        var addressBArr = $.parseJSON(addressB);

        $("input[name='name']").val(addressBArr[$("#address-selector-id").val()]['name']);
        $("input[name='street']").val(addressBArr[$("#address-selector-id").val()]['street']);
        $("input[name='city']").val(addressBArr[$("#address-selector-id").val()]['city']);
        $("input[name='zip']").val(addressBArr[$("#address-selector-id").val()]['zip']);
        $("input[name='phone']").val(addressBArr[$("#address-selector-id").val()]['phone']);
        $("input[name='company']").val(addressBArr[$("#address-selector-id").val()]['company']);
        $("input[name='vatin']").val(addressBArr[$("#address-selector-id").val()]['vatin']);
        $("input[name='vatid']").val(addressBArr[$("#address-selector-id").val()]['vatid']);
    });

// Fill delivery address open 12
    $("select[name=addresses_del]").change(function () {
        var addressD = $("#addressarr").val();
        var addressBArr = $.parseJSON(addressD);

        $("input[name='del_name']").val(addressBArr[$("#del-address-selector-id").val()]['name']);
        $("input[name='del_street']").val(addressBArr[$("#del-address-selector-id").val()]['street']);
        $("input[name='del_city']").val(addressBArr[$("#del-address-selector-id").val()]['city']);
        $("input[name='del_zip']").val(addressBArr[$("#del-address-selector-id").val()]['zip']);
        $("input[name='del_phone']").val(addressBArr[$("#del-address-selector-id").val()]['phone']);
        $("input[name='del_company']").val(addressBArr[$("#del-address-selector-id").val()]['company']);
    });
});
